function tryPDF(){
var docs = new jsPDF();

var imgData = 'data:image/jpeg;base64,';
//var data = document.getElementById('details');
	docs.addImage(imgData, 'JPEG', 35, 10, 140, 40);
	
	//data
	
	docs.setLineWidth(0.5);
	docs.setFontSize(20);
	docs.setFont("courier");
	docs.text(85,40, 'Feedback Details');
	var specialElementHandlers = {
    '#editor': function(element, renderer){
        return true;
    }
	};

	docs.fromHTML($('#details').get(0), 20, 20, {
    'width': 50, 
    'elementHandlers': specialElementHandlers
});
	
	//docs.fromHTML(document.data);
	docs.output('datauri');
}
